function FormCard() {
  return (
    <div className="form-card">
        <div className="header">
        <h2 >Weather App</h2>
        </div>
        <hr></hr>
      <form className="form">
        <input type="text" placeholder="Enter city name"></input>
      </form>
      <div className="median-line">
      <div className="line"></div>
      <span>or</span>
      <div className="line"></div>
      </div>
      <div className="btn-form">
      <button className="btn">Get Device Location</button>
      </div>
    </div>
  );
}

export default FormCard;
